import { colors } from "./SudokuBoard";

type AnswersProps = {
  board: number[][];
};

export default function Answers({ board }: AnswersProps) {
  return (
    <div className="board">
      {board.map((box, index) => (
        <div className="grid-box">
          {box.map((cell, cellIndex) => (
            <div
              className="cell-item"
              style={{ backgroundColor: colors[index] }}
            >
              <input
                defaultValue={cell}
                className="input-cell"
                readOnly={true}
                style={{ cursor: "default" }}
              />
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}
